import urllib.request
# 下载网页
url_page = "https://www.google.co.jp/videohp?hl=ja"
urllib.request.urlretrieve(url_page,"google.html")
# 下载图片
url_photo="data:image/jpeg;base64,"
urllib.request.urlretrieve(url_photo,"YUUKA.jpg")

# 下载视频
url_video="https://youtu.be/w_4b2ip77Mo"
header ={'User-Agent':'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/140.0.0.0 Safari/537.36'}
request = urllib.request.Request(url_video,headers=header)
urllib.request.urlretrieve(request,"video.mp4")

